function createEl() {
	let maskEl = document.createElement('div')
	let loadingEl = document.createElement('img')
	
	loadingEl.src='data:image/gif;base64,'
	
	loadingEl.style.width = '58px'
	maskEl.append(loadingEl)
	Object.assign(maskEl.style, {
		position: 'absolute',
		zIndex: 999999,
		backgroundColor: 'rgba(255, 255, 255, 0.9)',
		margin: 0,
		top: 0,
		right: 0,
		bottom: 0,
		left: 0,
		transition: 'opacity 0.3s',
		justifyContent: 'center',
		alignItems: 'center',
		display: 'flex'
	})
	loadingEl.className = 'p-loading'

	return {maskEl, loadingEl}
}


const loading = {
  update(el, binding, vnode, oldVnode) {
		if (el.id == 'wrapper') {
			el._maskEl.style.backgroundColor = ''
		} else {
			el._maskEl.style.backgroundColor = 'rgba(255, 255, 255, 0.9)'
		}
		el._maskEl.style.display =  binding.value ? 'flex' : 'none'
  }, bind(el, binding, vnode, oldVnode) {
		el._maskEl = createEl().maskEl
		el.append(el._maskEl)
	},
}

export {
	createEl,
}

export default loading
